import logo from './logo.svg';
import './App.css';

const blockRand = [
  {
    color: 'black',
    position: 'col-6'
  },
  {
    color: 'black',
    position: 'col-6'
  },
  {
    color: 'black',
    position: 'col-6'
  },
  {
    color: 'black',
    position: 'col-6'
  }
]

function App() {
  return (
    <div className="row">
      { blockRand.map((b) => {
        <div className={b.color + ' ' + b.position}></div>
      })}
    </div>
  );
}

export default App;
